import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import { AuthProvider } from "../src/components/";
import ProtectedRoute from "../src/components/App/ProtectedRoutes";

import Home from "./components/App/Home/Home";
import Services from "./components/App/Services/Services";
import Gallery from "./components/App/Gallery/Gallery";
import Calendar from "./components/App/Calendar/Calendar";
import About from "./components/App/About/About";

import Login from "./components/Auth/Login";
import Register from "./components/Auth/Register";

export default function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Public pages */}
          <Route path="/" element={<Home />} />
          <Route path="/services" element={<Services />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/about" element={<About />} />

          {/* Auth pages */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Protected pages */}
          <Route
            path="/calendar"
            element={
              <ProtectedRoute>
                <Calendar />
              </ProtectedRoute>
            }
          />
        </Routes>
      </Router>
    </AuthProvider>
  );
}
